        e.execute(equals);
        Thread successful = e.successful;
        assertThat(successful, is(not(nullValue())));
        assertThat(successful.isAlive(), is(true));
        Thread.sleep(1500);
        assertThat(successful.isAlive(), is(false));
        assertThat(equals.ran.get(), is(true));
